import { Component, OnInit } from '@angular/core';
import { FeedbackComponent } from 'src/app/services/feedback.service';
import { HttpClient } from '@angular/common/http';
import { Router } from '@angular/router';

@Component({
  selector: 'app-feedback',
  templateUrl: './feedback.component.html',
  styleUrls: ['./feedback.component.css']
})
export class FeedbackComponent {

  ubicaciones: any[] = [];
  newUbicacion: any = {};
  editingUbicacion: any = null;
  error = '';

  private apiUrl = 'http://localhost:3000/api/ubicacion';

  constructor(
    private ubicacionService: UbicacionService, private http: HttpClient, private router: Router ) { }

  ngOnInit(): void {
    this.loadUbicaciones();
  }






}
